import React from 'react';
import {Grid,Card, CardContent, Typography} from '@material-ui/core';

const Index=()=>{
return(
    <Grid container direction="row" justify="center" alignItems="center">
        <Grid item xs={12}>
        <Card>
            <CardContent>
                <Typography>
                    Log In/Out
                </Typography>
            </CardContent>
        </Card>
        </Grid>
    </Grid>
);
}
export default Index;
